import React from 'react'
import "../../assets/css/sidemenu.css";

const TopTags = () => {
  return (
    <div className='topTags ms-2'>
        <div className='topTagsBox'>
            <div className='pt-2 ps-2'>
                <h2 className='h6'>Top Tags</h2>
            </div>
        </div>
    </div>
  )
}

export default TopTags
